import { useState } from "react";

function MyTask() {
  const [tasks, setTasks] = useState([]);

  return (
    <div>
      <h1>My Tasks</h1>
      <div>
        {tasks.length > 0 && <p>My Tasks</p>}
        {tasks.length === 0 && <p>There is no Task added</p>}
      </div>
    </div>
  );
}

export default MyTask;
